import { useTranslation } from 'react-i18next';

import { Button, Dialog, DialogActions, DialogContent, DialogTitle } from '@mui/material';
import { makeStyles } from '@mui/styles';

const useStyles = makeStyles({});

export default function DialogDownload(props) {
  const { open, handleClose } = props;
  const { t } = useTranslation('travelsPage');
  const classes = useStyles();

  return (
    <Dialog
      open={open}
      onClose={handleClose}
      aria-labelledby="alert-dialog-title"
      aria-describedby="alert-dialog-description"
    >
      <DialogTitle id="alert-dialog-title">
        {t('TRAVEL_DIALOG_DOWNLOAD_DOCUMENT_TITLE')}
      </DialogTitle>
      <DialogContent dividers>mensaje</DialogContent>
      <DialogActions>
        <Button
          onClick={(evt) => {
            evt.stopPropagation();
          }}
          autoFocus
          variant="contained"
          color="secondary"
        >
          {t('TRAVEL_DIALOG_ADD_NOTE_ACCEPT')}
        </Button>
        <Button onClick={handleClose} variant="contained" color="error">
          {t('TRAVEL_DIALOG_RUN_NEW_CANCEL')}
        </Button>
      </DialogActions>
    </Dialog>
  );
}
